import { createRouter, createWebHistory } from 'vue-router'
import Home from '../src/components/Home.vue'

const routes = [
    {
        path: '/',
        name: 'Home',
        component: Home
    },

]

const router = routes.createRouter({
    history: routes.createWebHashHistory(),
    routes,
})

module.exports = router
